      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE col1 + ( 62 ) + + 77 NOT BETWEEN + col1 * + - ( col2 ) * + col1 - + - 35 AND - + ( + col0 );
  - name: tab0

outputs:
